INSERT INTO `zzqf_papers` (`id`, `title`, `descp`) VALUES
(3, '2012年度组织气氛调查问卷（部门/中心）', '欢迎参加2012年度组织气氛调查（部门/中心），请您阅读以下说明后再行评测：\r\n1.每一题由一对相反的陈述句组成，两个陈述均须阅读；\r\n2.勾选左端的框说明最近似左端的情况，选择右端的框说明最近似右端的情况。答案的位置越靠近陈述，则说明该陈述越能描述你部门的情况；\r\n3.每个题目只能选择一个选项，且所有题目的选项如果完全相同，则视为评估无效； \r\n4.测评过程不允许中断，请您安排好时间一次性完成测评，并点击提交。\r\n再次感谢您的积极参与！ \r\n'),
(4, '2012年度组织气氛调查问卷（事业部/城市公司）', '欢迎参加2012年度组织气氛调查（事业部/城市公司），请您阅读以下说明后再行评测： \r\n1.每一题由一对相反的陈述句组成，两个陈述均须阅读； \r\n2.勾选左端的框说明最近似左端的情况，选择右端的框说明最近似右端的情况。答案的位置越靠近陈述，则说明该陈述越能描述你部门的情况； \r\n3.每个题目只能选择一个选项，且所有题目的选项如果完全相同，则视为评估无效； \r\n4.测评过程不允许中断，请您安排好时间一次性完成测评，并点击提交。\r\n再次感谢您的积极参与！ '),
(5, '实测', '');
